// export default function Icon({n}: {n: string}) {
export default function Icon({n: n}: {n: string}) {
    let content : ReactElement[] = []
    let svgClassname = "h-4 w-4"
    switch (n) {
        case "atk":
        case "atk%":
            content = atkIcon()
            break;
        case "def":
        case "def%":
            content = defIcon()
            break;
        case "hp":
        case "hp%":
            content = hpIcon()
            break;
        case "em":
            content = emIcon()
            break;
        case "er%":
            content = erIcon()
            break;
        case "cr%":
            content = critRateIcon()
            break;
        case "cdmg%":
            content = critDmgIcon()
            break;
        case "CD Red.":
            content = cdRedIcon()
            break;
        case "heal in%":
            content = healBonusIcon()
            break;
        case "heal out%":
            content = healBonusIcon()
            break;
        case "shield%":
            content = shieldIcon()
            break;
        case "stamina":
            content = staminaIcon()
            break;
        case "anemo dmg%":
        case "anemo dmg":
        case "anemo":
            content = anemoIcon()
            svgClassname = svgClassname.concat(" fill-teal-500")
            break;
        case "geo dmg%":
        case "geo dmg":
        case "geo":
            content = geoIcon()
            svgClassname = svgClassname.concat(" fill-yellow-500")
            break;
        case "electro dmg%":
        case "electro dmg":
        case "electro":
            content = electroIcon()
            svgClassname = svgClassname.concat(" fill-violet-500")
            break;
        case "dendro dmg%":
        case "dendro dmg":
        case "dendro":
            content = dendroIcon()
            svgClassname = svgClassname.concat(" fill-lime-500")
            break;
        case "hydro dmg%":
        case "hydro dmg":
        case "hydro":
            content = hydroIcon()
            svgClassname = svgClassname.concat(" fill-blue-500")
            break;
        case "pyro dmg%":
        case "pyro dmg":
        case "pyro":
            content = pyroIcon()
            svgClassname = svgClassname.concat(" fill-red-500")
            break;
        case "cryo dmg%":
        case "cryo dmg":
        case "cryo":
            content = cryoIcon()
            svgClassname = svgClassname.concat(" fill-cyan-500")
            break;
        case "phys dmg%":
        case "phys dmg":
        case "phys":
            content = physIcon()
            svgClassname = svgClassname.concat(" fill-slate-500")
            break;
        case "fleur":
            content = fleurIcon()
            break;
        case "plume":
            content = plumeIcon()
            break;
        case "sablier":
            content = sablierIcon()
            break;
        case "coupe":
            content = coupeIcon()
            break;
        case "couronne":
            content = couronneIcon()
            break;
        default:
            content = defaultDotIcon()
            break;

    }
    let svg = <svg viewBox="0 0 24 24" className={svgClassname}>
                    {content}
                </svg>
    return <Tooltip child={svg} info={eStatToReadable(stringToEStat(n))} childClassname="" infoClassname="absolute bg-gray-800 text-white font-normal text-sm rounded p-2 whitespace-nowrap bottom-full left-1/2 transform -translate-x-1/2 " />
}